import { makeStyles } from '@material-ui/core/styles';

const BodyStyle = makeStyles((theme) => ({
    body: {
        backgroundColor: 'green',
        flexGrow: 1,
        marginTop: `${50}px`,
        height:'100vh',
        ...theme.mixins.toolbar,
    },
}));

export default BodyStyle;
